import React, { Component } from "react";
import { Shoe_Item } from "./Shoe_Item.js";
import { connect } from "http2";

class ListShoe extends Component {
  render() {
    return (
      <div className="col-6">
        hello world
        <Shoe_Item />
      </div>
    );
  }
}

export default connect()(ListShoe);
